import React, { useState } from "react";
import Form from "./Components/Form";

const Test = () => {
	const [state, updateState] = useState({
		name: "Vehbi"
	});

	const changeHandler = async () => {
		let x = await fetch("http://numbersapi.com/42");
		let data = await x.json();

		updateState({
			name: state.name,
			data
		});
	};

	return (
		<div>
			<p>Test</p>
			<Form name={state.data} change={changeHandler} />
		</div>
	);
};

export default Test;
